import React, {Component} from 'react';
import './App.css';
import IngredientSection from './components/IngredientSection';
class App extends Component {
  state = {
    ingredientList: [
      {
        id: 1,
        title: "Brioche"
      },
      {
        id: 2,
        title: "Custard"
      },
      {
        id: 3,
        title: "Strawberry"
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>Ingredient List</h1>
        <IngredientSection />
      </div>
    );
  }
}

export default App;
